
SET FOREIGN_KEY_CHECKS=0;

DROP TABLE IF EXISTS `npc_ai_data`;
CREATE TABLE `npc_ai_data` (
  `npc_id` int(5) NOT NULL DEFAULT '0',
  `min_skill_chance` int(3) DEFAULT '7',
  `max_skill_chance` int(3) DEFAULT '15',
  `primary_attack` int(1) DEFAULT '0',
  `can_move` tinyint(1) NOT NULL DEFAULT '1',
  `minrangeskill` int(5) DEFAULT '0',
  `minrangechance` int(3) DEFAULT '0',
  `maxrangeskill` int(5) DEFAULT '0',
  `maxrangechance` int(3) DEFAULT '0',
  `soulshot` int(4) DEFAULT '0',
  `spiritshot` int(4) DEFAULT '0',
  `spschance` int(3) DEFAULT '0',
  `sschance` int(3) DEFAULT '0',
  `is_chaos` int(4) DEFAULT '0',
  `aggro` smallint(4) NOT NULL DEFAULT '0',
  `clan` varchar(40) DEFAULT NULL,
  `clan_range` int(4) DEFAULT '0',
  `enemy_range` int(4) DEFAULT '0',
  `enemy_clan` varchar(40) DEFAULT NULL,
  `ai_type` varchar(8) DEFAULT 'fighter',
  PRIMARY KEY (`npc_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

